import React, {Fragment} from 'react';
import GetInTouch from './get-in-touch';
import ContactUsDetails from './contact-us-details';

const ContactUsPage = () => {
    return (
        <Fragment>
            <GetInTouch />
            <ContactUsDetails />
        </Fragment>
    )
}

export default ContactUsPage;
